import { API } from "../../config/api";
import { useQuery } from "react-query";
import CardNearyou from "../../compnents/card/CardNearyou";
import { PopularLoading } from "../../compnents/card/CardLoading";

//useQuery = method GET
//useMutation = method POST, PUT, PATCH & DELETE

const Nearyou = () => {
	const {
		data: restaurantData,
		error: restaurantError,
		loading: restaurantLoading,
		refetch: restaurantRefetch,
	} = useQuery("restaurantsCache", async () => {
		return API.get("/restaurants");
	});

	return (
		<>
			<div className="row ">
				<div className="my-2 col-12">
					<h2>Popular Restaurant</h2>
				</div>

				{restaurantLoading ? (
					<tr>
						<td colSpan="4">Loading Data</td>
					</tr>
				) : (
					restaurantData?.data?.data?.restaurants?.map((restaurant, index) => (
						<PopularLoading />
						// <CardNearyou data={restaurant} index={index} key={restaurant.id} />
					))
				)}
			</div>
		</>
	);
};

export default Nearyou;
